sys_variable_value.value:
(function execute(inputs, outputs) {

    var relPathStr = inputs.relPath;

    var resultJSON = '';
    var createdJSON = new LaufwerkADDataObjectLoader();

    resultJSON = createdJSON.getLaufwerkONewJSON(relPathStr);

    //outputs.resjson = resultJSON.toString();
    outputs.resjson = JSON.stringify(resultJSON);
    

    /*
    var resultJSONArr = [];
    var createdJSON = new LaufwerkADDataObjectLoader();

    resultJSONArr.push(createdJSON.getLaufwerkONewJSON(relPathStr));

    outputs.resjson = JSON.stringify(resultJSONArr);
    */

})(inputs, outputs);

